let badgePNG =
  " data:image/png;base64,";
let earthlyBadgeImage = document.getElementById("earthly-badge-image");
earthlyBadgeImage.src = badgePNG;

let earthlyBadge = document.getElementById("earthly-badge");
let badgeLocation = earthlyBadge.getAttribute("badgeLocation");
let badgePlacement = earthlyBadge.getAttribute("badgePlacement");
let badgeAlignment = earthlyBadge.getAttribute("badgeAlignment");
let badgeSize = earthlyBadge.getAttribute("badgeSize");
let badgeMargin = earthlyBadge.getAttribute("badgeMargin");
let badgeLocationC = earthlyBadge.getAttribute("badgeLocationC");
let badgePlacementC = earthlyBadge.getAttribute("badgePlacementC");
let badgeAlignmentC = earthlyBadge.getAttribute("badgeAlignmentC");
let badgeSizeC = earthlyBadge.getAttribute("badgeSizeC");
let badgeMarginC = earthlyBadge.getAttribute("badgeMarginC");

if (window.location.href.indexOf("oseid") != -1) {
  var cusid_ele = document.forms;
  for (var i = 0; i < cusid_ele.length; i++) {
    var item = cusid_ele[i];
    var mySpan = document.createElement("span");
    var mySpan2 = document.createElement("span");

    mySpan.style.color = "red";
    mySpan.style.width = "100%";
    mySpan.style.display = "block";
    mySpan.style.textAlign = "center";
    mySpan.style.border = "1px red dashed";
    mySpan.innerHTML = "BLOCK " + i + " AFTER";
    item.after(mySpan);
    mySpan2.style.color = "red";
    mySpan2.style.width = "100%";
    mySpan2.style.display = "block";
    mySpan2.style.textAlign = "center";
    mySpan2.style.border = "1px red dashed";
    mySpan2.innerHTML = "BLOCK " + i + " BEFORE";
    item.before(mySpan2);
  }
}

if (window.location.href.indexOf("product") != -1) {
  earthlyBadge.style.textAlign = badgeAlignment;
  earthlyBadgeImage.style.width = badgeSize;
  earthlyBadge.style.margin = badgeMargin;
  if (badgePlacement == "after") {
    document.forms[badgeLocation].after(earthlyBadge);
  } else if (badgePlacement == "before") {
    document.forms[badgeLocation].before(earthlyBadge);
  }
} else {
  earthlyBadge.style.textAlign = badgeAlignmentC;
  earthlyBadgeImage.style.width = badgeSizeC;
  earthlyBadge.style.margin = badgeMarginC;
  if (badgePlacementC == "after") {
    document.forms[badgeLocationC].after(earthlyBadge);
  } else if (badgePlacementC == "before") {
    document.forms[badgeLocationC].before(earthlyBadge);
  }
}
